import { useEffect, useState } from 'react';

import { Search, ShoppingBagOutlined } from '@mui/icons-material';
import {
  Box,
  Card,
  CardActionArea,
  CardContent,
  CardMedia,
  Divider,
  Link,
  Typography,
} from '@mui/material';

import { api } from '../../services/api';
import { Category } from '../../types/category';

import Navbar from '../../components/Navbar';
import Carousel from '../../components/Carousel';

import * as S from './styles';

const Home = () => {
  const menuFooter = [
    {
      id: 1,
      text: 'Sobre Nós',
      link: 'about-us',
    },
    {
      id: 2,
      text: 'Perguntas Frequentes',
      link: 'commom-questions',
    },
    {
      id: 3,
      text: 'Fale Conosco',
      link: 'contact-us',
    },
    {
      id: 4,
      text: 'Envio e Prazo de Entrega',
      link: 'shipping-services',
    },
    {
      id: 5,
      text: 'Rastreamento',
      link: 'tracking',
    },
    {
      id: 6,
      text: 'Trocas e Devoluções',
      link: 'exchanges-returns',
    },
    {
      id: 7,
      text: 'Termos de serviço',
      link: 'service-terms',
    },
  ];
  const politicasFooter = [
    {
      id: 1,
      text: 'Políticas de Pagamento',
      link: 'payment-policies',
    },
    {
      id: 2,
      text: 'Termos de Uso',
      link: 'terms-of-use',
    },
    {
      id: 3,
      text: 'Política de cookies',
      link: 'cookie-policy',
    },
    {
      id: 4,
      text: 'Política de Reembolso',
      link: 'refund-policy',
    },
    {
      id: 5,
      text: 'Política de Privacidade',
      link: 'privacy-policy',
    },
  ];

  const [categories, setCategories] = useState<Category[] | any>();

  // const getProducts = async () => {
  //   try {
  //     const response = await api.get('products');
  //     // console.log('PRODUTOS', response.data);
  //   } catch (error) {
  //     console.log('ERROR:', error);
  //   }
  // };

  const getCategories = async () => {
    try {
      const response = await api.get(`categories?limit=5`);
      setCategories(response.data);
    } catch (error) {
      console.log('ERROR:', error);
    }
  };

  useEffect(() => {
    // getProducts();
    getCategories();
  }, []);

  const preventDefault = (event: React.SyntheticEvent) =>
    event.preventDefault();

  return (
    <>
      <Box
        sx={{
          height: '30px',
          width: '100%',
          display: 'flex',
          justifyContent: 'center',
          alignItems: 'center',
          backgroundColor: '#f0e6d7',
        }}
      >
        <Typography variant="body1">Frete Grátis para todo Brasil</Typography>
      </Box>
      <S.Container>
        <S.BoxAlign>
          <Typography variant="h4">Logo</Typography>
        </S.BoxAlign>

        <S.ContainerSearch>
          <S.BoxSearch>
            <S.BoxSearchIcon>
              <Search style={{ color: '#ffffff' }} />
            </S.BoxSearchIcon>
          </S.BoxSearch>
        </S.ContainerSearch>

        <S.BoxAlign>
          <ShoppingBagOutlined />
        </S.BoxAlign>
      </S.Container>

      <S.ContainerNavbar display="flex" justifyContent="center">
        <Box display="flex" width="70%" justifyContent="space-between">
          <Navbar options={categories} />
        </Box>
      </S.ContainerNavbar>

      <S.ContainerCarousel>
        <S.BoxCarousel>
          <S.WidthCarousel>
            <Carousel categories={categories} />
          </S.WidthCarousel>
        </S.BoxCarousel>
      </S.ContainerCarousel>
      <Box
        sx={{
          display: 'flex',
          justifyContent: 'center',
        }}
      >
        <Box
          sx={{
            width: '70%',
            flexDirection: 'column',
          }}
        >
          <Typography
            display="flex"
            justifyContent="center"
            my={5}
            variant="h4"
          >
            Categorias
          </Typography>

          <Box
            sx={{
              width: '100%',
              display: 'flex',
              justifyContent: 'space-around',
              flexDirection: 'row',
              flexWrap: 'wrap',
            }}
          >
            {categories?.map((item: any) => {
              return (
                <Box
                  sx={{
                    width: '150px',
                    display: 'flex',
                    flexDirection: 'column',
                    alignItems: 'center',
                    justifyContent: 'center',
                  }}
                >
                  <Card
                    sx={{
                      width: '100px',
                      borderRadius: '100%',
                    }}
                  >
                    <CardActionArea>
                      <CardMedia
                        component="img"
                        height="100px"
                        image={item.image}
                        alt={item.name}
                      />
                    </CardActionArea>
                  </Card>
                  <CardContent>
                    <Typography gutterBottom variant="h5" component="div">
                      {item.name}
                    </Typography>
                  </CardContent>
                </Box>
              );
            })}
          </Box>
        </Box>
      </Box>
      <Box
        sx={{
          height: '50vh',
          backgroundColor: 'green',
          width: '100%',
          display: 'flex',
          flexWrap: 'wrap',
          justifyContent: 'space-around',
          alignItems: 'center',
        }}
      >
        <Box
          sx={{
            display: 'flex',
            flexDirection: 'column',
            width: '100%',
          }}
        >
          <Box
            sx={{
              display: 'flex',
              flexDirection: 'row',
              justifyContent: 'space-around',
            }}
          >
            <Box
              sx={{
                height: '20vh',
                display: 'flex',
                flexDirection: 'column',
                justifyContent: 'center',
              }}
            >
              <Typography color="#ffffff" mb={2} variant="body1">
                Menu
              </Typography>
              {menuFooter.map((item) => (
                <Link href="#" variant="body2" underline="none" color="#ffffff">
                  {item.text}
                </Link>
              ))}
            </Box>
            <Box
              sx={{
                display: 'flex',
                flexDirection: 'column',
                height: '20vh',
              }}
            >
              <Typography color="#ffffff" mb={2} variant="body1">
                Políticas
              </Typography>
              {politicasFooter.map((item) => (
                <Link href="#" variant="body2" underline="none" color="#ffffff">
                  {item.text}
                </Link>
              ))}
            </Box>
            <Box
              sx={{
                display: 'flex',
                height: '20vh',

                flexDirection: 'column',
              }}
            >
              <Typography color="#ffffff" mb={2} variant="body1">
                Fale Conosco
              </Typography>
              <Typography color="#ffffff" variant="body2">
                Horário de Atendimento:
              </Typography>
              <Typography color="#ffffff" variant="body2">
                Seg. à Sab. 9:00h às 18:00h
              </Typography>
              <Typography color="#ffffff" variant="body2">
                E-mail: sac@lorenipsum.com.br
              </Typography>
            </Box>
          </Box>
          <Box sx={{ marginY: '50px ', width: '100%' }}>
            <Divider />
          </Box>
          <Typography textAlign={'end'} marginRight={5}>Copyright © 2023</Typography>
        </Box>
      </Box>
    </>
  );
};

export default Home;
